import { useState } from 'react';
import axios from 'axios';
import { LineChart, Line, XAxis, YAxis, Tooltip, CartesianGrid } from 'recharts';

interface SunEvent {
  date: string;           // Date string (e.g. "2025-06-02")
  sunrise: string;        // Time string (e.g. "6:14:44 AM")
  sunset: string;
  golden_hour: string;
}

function timeStringToMinutes(t: string): number {
  const [time, meridian] = t.split(' ');
  let [h, m, s] = time.split(':').map(Number);
  if (meridian === 'PM' && h !== 12) h += 12;
  if (meridian === 'AM' && h === 12) h = 0;
  return h * 60 + m + s / 60;
}

function App() {
  const [location, setLocation] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [data, setData] = useState<SunEvent[]>([]);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:3000/sunrise', {
        params: { location, date_start: startDate, date_end: endDate }
      });
      setData(response.data);
    } catch (error) {
      alert('Error fetching data');
    }
  };

  // Prepare data for chart by converting times to minutes from midnight
  const chartData = data.map(event => ({
    date: event.date,
    sunrise_minutes: timeStringToMinutes(event.sunrise),
    sunset_minutes: timeStringToMinutes(event.sunset),
  }));

  return (
    <div style={{ padding: '20px' }}>
      <h1>Sun Event Tracker</h1>

      <input
        placeholder="Location"
        value={location}
        onChange={e => setLocation(e.target.value)}
        style={{ marginRight: 10 }}
      />
      <input
        type="date"
        value={startDate}
        onChange={e => setStartDate(e.target.value)}
        style={{ marginRight: 10 }}
      />
      <input
        type="date"
        value={endDate}
        onChange={e => setEndDate(e.target.value)}
        style={{ marginRight: 10 }}
      />
      <button onClick={fetchData}>Get Data</button>

      {data.length > 0 && (
        <>
          <h2>Results</h2>
          <table border={1} cellPadding={5} cellSpacing={0}>
            <thead>
              <tr>
                <th>Date</th>
                <th>Sunrise</th>
                <th>Sunset</th>
                <th>Golden Hour Start</th>
              </tr>
            </thead>
            <tbody>
              {data.map(event => (
                <tr key={event.date}>
                  <td>{event.date}</td>
                  <td>{event.sunrise}</td>
                  <td>{event.sunset}</td>
                  <td>{event.golden_hour}</td>
                </tr>
              ))}
            </tbody>
          </table>

          <LineChart width={700} height={300} data={chartData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
            <CartesianGrid stroke="#ccc" />
            <XAxis dataKey="date" />
            <YAxis label={{ value: 'Minutes from midnight', angle: -90, position: 'insideLeft' }} />
            <Tooltip />
            <Line type="monotone" dataKey="sunrise_minutes" stroke="#8884d8" name="Sunrise" />
            <Line type="monotone" dataKey="sunset_minutes" stroke="#82ca9d" name="Sunset" />
          </LineChart>
        </>
      )}
    </div>
  );
}

export default App;
